import React, { useState } from "react";
import { ThemeProvider, Div, Button, Text, Icon, Row, Col, Image } from "atomize";


function TrendingTitles() {
  const theme = {
    fontFamily: {
      primary: 'Bitter, serif',
      secondary: 'Oswald, serif',
    }
  }

  return(
    <ThemeProvider theme={theme}>
      <Div style={{backgroundColor: "lightskyblue"}}>
        <Text>Discuss and share your favorite Netflix titles</Text>
        <h2>Trending Now</h2>
        <Div></Div>
      </Div>
    </ThemeProvider>
  )
}

export default TrendingTitles;
